import React from "react";
import "./App.scss";

function App() {
  return (

    <div role="custom-dropdown">
    <input type="checkbox" id="button" />
    <label for="button" onclick></label>

    <ul>
        <li><a href="#">Stream</a></li>
        <li><a href="#">Lab</a></li>
        <li><a href="#">Projects</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Contact</a></li>
    </ul>
   </div>
  );
}

export default App;
